import React from "react";
import CatalogListHomePage from "../CatalogListHomePage";

export default function CatalogHomePage() {
  return (
    <div>
      <div>
        <h1>Catalog</h1>
        <button>All categories</button>
      </div>
      <div>
        <CatalogListHomePage/>
      </div>
    </div>
  );
}
